Change a single value of a subdocument in mongodb<p>I have a Model called <code>Notes</code>. It has a subdocument <code>requests</code> which holds various documents with values <code>userId</code>, <code>reqType</code>, <code>accepted</code> value( <code>false</code> by default) and <code>noteId</code> of the sender, request and note respectively. When the user hits a certain route I want to keep all the data to be as their previous values, just updating the <code>accepted</code> field to <code>true</code>.</p>

<p>The below code leads to no change in the data or a different iteration leads to erasing all the data other than <code>accepted</code> field and modifying it to <code>true</code>.</p>

<p>How should I do this?</p>

<pre><code>const noteSchema = new mongoose.Schema(
    requests: [
      {
        userId: mongoose.Schema.ObjectId,
        noteId: mongoose.Schema.ObjectId,
        reqType: String,
        accepted: {
          type: Boolean,
          default: false,
        },
      },
    ],
  }
)

const Note = mongoose.model('Note', noteSchema)

const note = await Note.findById(req.body.noteId)

await note.updateOne({
      requests: {
        $elemMatch: {
          userId: req.body.userId,
          reqType: req.body.reqType,
          noteId: req.body.noteId,
        },
        $set: { "requests.$.accepted": true },
      }, 
    })
</code></pre>

